INSERT INTO `sys_log` VALUES ('1234321547989135361', 2, '线索-编辑', 3, 'admin', '管理员', '127.0.0.1', 'org.jeecg.modules.xs.controller.QbSwxszbController.edit()', NULL, '[{\"cjsj\":1581955200000,\"createBy\":\"admin\",\"createTime\":1581955200000,\"id\":\"1229681141187883010\",\"qbSwxszbfjList\":[{\"createBy\":\"admin\",\"createTime\":1583120164274,\"fjmc\":\"测试附件\",\"id\":\"15820137516150\",\"scsbbm\":\"00c-989-9788901\",\"swxsbh\":\"1229681141187883010\",\"wjlj\":\"avatar_96px_1582601970368.png\"},{\"createBy\":\"admin\",\"createTime\":1583120164277,\"fjmc\":\"分析\",\"id\":\"15825113350511\",\"scsbbm\":\"01411\",\"swxsbh\":\"1229681141187883010\",\"wjlj\":\"cee88f513709f827c28194b9eef40c64_1582602426246.mp4\"}],\"scsj\":1581955200000,\"updateBy\":\"admin\",\"updateTime\":1583078400000,\"wxdj\":\"wxdj_z\",\"xsbt\":\"这是测试线索标题\",\"xsddbh\":\"\",\"xsddmc\":\"省政府\",\"xsxq\":\"聚集 锁定\\nju ji\\n聚集(Aggregation)是一种特殊形式的关联。聚集表示类之间的关系是整体与部分的关系。一辆轿车包含四个车轮、一个方向盘、一个发动机和一个底盘,这是聚集的一个例子。在需求分析中,\\\"包含\\\"、\\\"组成\\\"、\\\"分为……部分\\\"等经常设计成聚集关系。聚集可以进一步划分成共享聚集(Shared Aggregation)和组成。例如,课题组包含许多成员,但是每个成员又可以是另一个课题组的成员,即部分可以参加多个整体,我们称之为共享聚集。另一种情况是整体拥有各部分,部分与整体共存,如整体不存在了,部分也会随之消失,这称为组成(Composition)。例如,我们打开一个视窗口,它就由标题、外框和显示区所组成。一旦消亡则各部分同时消失。在UML中,聚集表示为空心菱形,组成表示为实心菱形。\\n聚集是一种优化措施。 [1]  ﻿\"}]', NULL, 20, 'admin', '2020-03-02 11:36:04', NULL, NULL);
